    public int uniquePathsWithObstacles(int[][] obstacleGrid) {
        int n = obstacleGrid.length;
        int m = obstacleGrid[0].length;
        int[][] num = new int[n][m];
        num[n - 1][m - 1] = 1;
        for (int i = n - 1; i >= 0; i--) {
            for (int j = m - 1; j >= 0; j--) {
                if (obstacleGrid[i][j] == 1) {
                    num[i][j] = 0;
                }
                else if (i + 1 < n && j + 1 < m) {
                    num[i][j] = num[i + 1][j] + num[i][j + 1];
                } else if (i + 1 < n) {
                    num[i][j] = num[i + 1][j];
                } else if (j + 1 < m) {
                    num[i][j] = num[i][j + 1];
                }
            }
        }
        return num[0][0];
    }



